  Készen álltok egy fergeteges salsa estére? Június 8-án a Csabai Rendezvénypajtában igazi salsa hangulat vár rátok!


  Salsa Est a Csabai Rendezvénypajtában

  📅 Időpont: Június 8. 19:00 - 00:00

  • A RENDEZVÉNY INGYENES‼️


  19:00-20:00 – Salsa Workshop

  A Salsa Műhely profi oktatói érkeznek hozzánk, hogy megtanítsanak benneteket a salsa alapjaira és haladó mozdulataira. Ne hagyjátok ki ezt az egyedülálló lehetőséget, hogy a legjobbak vezetésével fejlesszétek tánctudásotokat!


